import React, { Component } from 'react';
import {Container} from 'reactstrap'

import './App.css';

export default class App extends Component {
  render() {
    return (
        <Container>
            <div className="App">
                <header className="HackCU">
                <h1>HACKCU 2019</h1>
                    <a href={""}></a>
                </header>
            </div>
        </Container>
    );
  }
}
